import React, { useState } from 'react'
import '../App.css';
import BookSeats from './BookSeats';
// import '../Images'
// C:\Users\Brahmendra Bachi\React\bus-management\src\Images

const Buses = ({busData}) => {

  const [mySeats, setMySeats] = useState([]);
  const [bookedSeats, setBookedSeats] = useState([]);
  const [allSeats, setAllSeats] = useState([]);
  const [date, setDate] = useState('');
  const [busId, setBusId] = useState('');
  const [indexes, setIndexes] = useState('');
  const [sample, setSample] = useState(0);

  var formatter = new Intl.NumberFormat('en-US', {
            style: 'currency',
            currency: 'INR',
        })

  const gotoSeatsPage=()=>{

    if(allSeats.length!=0)
    {
      var allData = {mySeats, bookedSeats, allSeats, date, busId, indexes};
      return <BookSeats data={allData} />
    }
  }

 const [buses, setBuses] = useState(busData)
 var url = ""

 const isBooked=(num, mySeats, bookedSeats)=>{
  if(num in mySeats)
  {
    console.log(num, bookedSeats)
    return <button >{num}</button>
  }
  else{
    return <p className='block2'>{num}</p>
  }
 }

 const viewSeats=(vacancySeats, journeyDate, id, indexValues)=>{
  if(vacancySeats.length == 0)
  {
    return <h2 className='text-danger'> No Available Seats to Book </h2>
  }

  let str = vacancySeats.substring(0, vacancySeats.length-1);

  var dum1 = str.split(",");
  console.log("Dum1");
  console.log(dum1);

  // console.log(mySeats)

  var dum2 = [];

  for(let i=1;i<26;i++)
  {
    console.log(i.toString());
    console.log(dum1.includes(i.toString(), 0))
    if((dum1.includes(i.toString(), 0)) ||  (i.toString()==dum1[dum1.length-1]))
    {
      continue;
    }
    else
    {
      // console.log(i);
      dum2.push(i.toString());
    }
  }

  var dum3 = [];
  dum3.push({"id" : ['1', '2', '3', '4']})
  dum3.push({"id" : ['5', '6', '7', '8']})
  dum3.push({"id" : ['9', '10', '11', '12']})
  dum3.push({"id" : ['13', '14', '15', '16']})
  dum3.push({"id" : ['17', '18', '19', '20']})
  setMySeats(dum1)
  setBookedSeats(dum2)
  setAllSeats(dum3)
  setDate(journeyDate);
  setBusId(id);
  setIndexes(indexValues);
 }

 const printData=()=>{
  console.log(buses)
 }
  

 const isViewSeats=(bus)=>{
  if(sample==0)
  {
    return <button className = "btn btn-danger" onClick = {() => viewSeats(bus.vacancySeats, bus.journeyDate, bus.buses.busId, bus.indexes)} > View Seats </button>
  }
 }
  return (
    <div>
     <div className='p-3'></div>
     <div className='container'>
      <h2 className='text-danger'>Available Buses</h2>
      <div className='p-3'></div>
      {
       buses.map(
              bus => (
                  <tr key={bus.buses}>
                   <div className='ex1'>
                   <div className='side-by-side'>
                    <img className='img' src="https://bit.ly/3dU4SGN"></img>
                    <div className='p-3'></div>
                    <h3 className='text-warning'> { bus.buses.busId } </h3>
                    <div className='p-3'> </div>
                    <h3 className='text-warning'> { bus.buses.busName } </h3>
                    <div className='p-3'> </div>
                    <h3 className='text-info'></h3>
                    <h3 className='text-warning'> { bus.bTime } </h3>
                    <div className='p-3'> </div>
                    <h3 className='text-warning'> { bus.dTime } </h3>
                    <div className='p-3'> </div>
                    <h3 className='text-warning'> {formatter.format(bus.cost)} </h3>
                    <div className='p-3'></div>
                    <h3 className='text-warning'> {bus.noOfSeats} seats availablle </h3>
                    <div className='p-3'></div>
                    {
                      isViewSeats(bus)
                    }
                   </div>
                   {
                    gotoSeatsPage()
                   }
                   </div>
                  </tr>
              )
       )
      }
     </div>
     
    </div>
  )
}

export default Buses
